import React, { useState } from 'react';
import './index.css';



function Time (){
    var a = new Date();
    var hours = a.getHours();
    var minutes = a.getMinutes();
    var seconds = a.getSeconds();
    return (
        <>
        <h1 className="number"><span>{0}</span>:<span>{0}</span>:<span>{0}</span>  <span>{"PM"}</span></h1>
            <button onClick="Click" className="button">
                Click Me
            </button>
        </>
    );
}
function Click(){

}
function Nav(){
    return (
     <div className="nav">
         <h2>List of my favourate webseries</h2>
     </div>
 );
 }


function App(){
    return(
        <>
        <Nav/>
        <Time/>
        </>
    );
}
export default App;
